Notes:
This show was webcast via LivePhish and was the third show of the Magnaball festival. Mike teased The Tears of a Clown before Punch You In the Eye. Buffalo Bill was played for the first time since June 22, 2012 (134 shows). Trey thanked the fans, crew, production staff and local officials during I Didn't Know while Fishman &quot;sucked love&quot; on his vacuum. Down With Disease was unfinished. Immigrant Song was teased in both Twist and Weekapaug Groove. Mainstreet was teased in Weekapaug Groove, which was unfinished. Mike teased Brick House in You Enjoy Myself, which culminated in a fireworks display and a quote from The Very Long Fuse to celebrate the end of the festival


